                    schema:
                        type: string
            responses:
                200:
                    description: '200'
                    content:
                        application/json:
                            schema:
                                type: boolean
                                example: true
            tags:
                - Review
            security: []
        parameters:
            -
                in: path
                name: review
                description: 'review id'
                example: '2'
                required: true
                schema:
                    type: string
